import merge from 'lodash/merge';

import * as ACTIONS from '../actions/constants';
import { clone, getFromLocalStorage } from '../util';


const initialState = {
  stepIndex: 0,

  lob: {
    apiKey: getFromLocalStorage('LOB_API_KEY', '')
  },
  size: {
    selectedIndex: 0,
    sizes: [
      {
        name: '4x6',
        display: '4"x6"',
        price: 0.70,
        width: 6.25,
        height: 4.25
      },
      {
        name: '6x11',
        display: '6"x11"',
        price: 1.50,
        width: 11.25,
        height: 6.25
      }
    ]
  },
  image: {
    data: '',
    //data: 'data:image/jpeg;base64,',
    //data: 'data:image/jpeg;base64,',
    //data: 'data:image/jpeg;base64,',

    // none
    // landscape
    // portrait
    // square
  },
  message: {
    content: '',
    font: 'Helvetica',
    fontSize: 14
  },
  address: {
    showModal: false,
    selectedToIndex: -1,
    selectedFromIndex: -1,
    addresses: getFromLocalStorage('ADDRESSES', [])
  },
  preview: {
    side: 'front',
    frontData: '',
    backData: ''
  },
  send: {
    isSending: false,
    didSend: false,
    response: ''
  }
};


export default function postcard(state=initialState, action) {
  switch (action.type) {
    case ACTIONS.GO_TO_STEP:
      var stepIndex = state.stepIndex;
      if (action.step === 'next') stepIndex++;
      else if (action.step === 'previous') stepIndex--;
      else stepIndex = action.step;
      return clone(state, { stepIndex });

    case ACTIONS.PERSIST_LOB_API_KEY:
      localStorage.setItem('LOB_API_KEY', action.apiKey);
      return state;

    case ACTIONS.EDIT_INPUT:
      return merge({}, state, action.value);

    case ACTIONS.ADD_NEW_ADDRESS:
      var addresses = [].concat(state.address.addresses, action.address);
      localStorage.setItem('ADDRESSES', JSON.stringify(addresses));
      return merge({}, state, { address: { addresses }});

    case ACTIONS.DELETE_ADDRESS:
      var addresses = [].concat(state.address.addresses);
      addresses.splice(action.index, 1);
      localStorage.setItem('ADDRESSES', JSON.stringify(addresses));
      return merge(
        {},
        state,
        { address: { addresses: null }},
        { address: { addresses }, selectedToIndex: -1 }
      );

    default:
      return state;
  }
}
